import React, { useState } from 'react';
import axios from "axios";

// Configure the Axios client
const client = axios.create({
    baseURL: "http://localhost:8080"
});

const Login = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const [errorMessage, setErrorMessage] = useState('');

    const handleSubmit = async (event) => {
 // Prevent default form submission behavior


        try {
            const response = await client.post("/login", {
                username: username,
                password: password
            });
            console.log(response.data);

            // Handle successful login, e.g., store the token, redirect to a different page, etc.
        } catch (error) {
            console.error("Login error: ", error);
            setErrorMessage(error.response?.data?.message || 'Login failed');

        }

    };

    return (
        <div className="row mt-3">
            <h3 className="col-6 offset-3">Login for Kite  &nbsp;
                <img src="media/images/logokite.png" style={{ width: "50px" }} />
            </h3>
            <div className="col-6 offset-3">
                <form onSubmit={handleSubmit} className="needs-validation" noValidate>

                    <div className="mb-3">
                        <label htmlFor="username" className="form-label">Username</label>
                        <input
                            name="username"
                            type="text"
                            className="form-control"
                            required
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="password" className="form-label">Password</label>
                        <input
                            name="password"
                            type="password"
                            className="form-control"
                            required
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                        />
                    </div>
                    <br />
                    {errorMessage && <div className="alert alert-danger">{errorMessage}</div>}
                    <button className="btn btn-success btn-danger" type="submit">SignUp</button>
                </form>
            </div>
        </div>
    );
};

export default Login;
